import React, { useEffect } from 'react';
import { Route, Routes } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import LandingPage from './components/LandingPage/LandingPage.js'
import NavBar from './components/NavBar/NavBar.js';
import Main from './components/Main/Main.js';
import RecipeDetail from './components/RecipeDetail/RecipeDetail.js';
import CreateRecipeSmart from './components/CreateRecipes/CreateRecipeSmart.js';
import { getDiets } from './redux/actions.js';
import { GlobalStyle } from './GlobalStyle.styled.js';

export default function App() {
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getDiets()); 
  }, [])

  return (
    <> 
      <GlobalStyle/>
      <NavBar/>
      <Routes>
        <Route path='/' element={ <LandingPage/> }/>
        <Route path='/home' element={ <Main/> }/>
        <Route path='/home/recipe/detail/:id' element={ <RecipeDetail/> }/>
        <Route path='/home/recipe/create' element={ <CreateRecipeSmart/> }/>
      </Routes>   
    </>

  );
};
